import React from 'react';
import { SignInButton } from '../components/SignInButton/SignInButton';

const LoginPage = () => {
	return (
		<div className="login-page">
			<div className="login-page__container">
				<h2></h2>
				<h1></h1>
				<SignInButton />
			</div>
		</div>
	);
};

export default LoginPage;
